INSERT INTO `footer` (`id`, `title`, `footer_desc`, `created_at`, `updated_at`) VALUES
(1, 'Domestic Flights with Travelmazi', '<p>TravelMazi&nbsp;is India&#39;s leading player for flight bookings and has a dominant position in the domestic flight sector. With the cheapest fare guarantee, experience great value at the lowest price. Instant notifications ensure current flight status, instant fare drops, amazing discounts, instant refunds and rebook options, price comparisons, and many more interesting features.</p>', '2020-11-17 10:53:51', '2020-11-18 04:32:13'),
(2, 'Booking Flights with Travelmazi', '<p>Book your flight tickets with India&#39;s leading flight booking company since the year 2000. While booking flights with TravelMazi, you can expect the ultimate online booking experience. With premium customer service, a 24/7 dedicated helpline for support, and over 5 million delighted customers, TravelMazi takes great pride in enabling customer satisfaction. With the cheapest flight guarantee, book your tickets at the lowest airfares. Avail of great offers, exclusive deals for loyal customers and get instant updates for your flight status and fare drops.</p>', '2020-11-17 10:54:15', '2020-11-18 04:31:51'),
(3, 'Why Travelmazi?', '<p>The leading player in online flight bookings in India, TravelMazi offers great offers, some of the lowest airfares, exclusive discounts, and a seamless online booking experience. Flight, hotel, and holiday bookings through the desktop or mobile site is a delightfully customer-friendly experience, and with just a few clicks you can complete your booking. With features like Instant Discounts, Fare Calendar, MyRewards Program, MyWallet, and many more, the overall booking experience with TravelMazi constantly adds value to its product and continues to offer the best to its customers.</p>', '2020-11-17 10:54:44', '2020-11-18 04:31:26');
